import React from "react";
import { Line } from "react-chartjs-2";
import ChartComponent from "../components/ChartComponent";
import "./D.css"
const Dashboard = () => {
  const chartData = {
    labels: ["Jan", "Feb", "Mar", "Apr", "May", "Jun"],
    datasets: [
      { label: "Students", data: [10, 30, 50, 20, 60, 80], borderColor: "#ff7f50", fill: false },
      { label: "Teachers", data: [5, 20, 40, 10, 50, 70], borderColor: "#36a2eb", fill: false },
     {  label: "Students Progress",
      data: [65, 59, 80, 81],
      backgroundColor: "rgba(75, 192, 192, 0.2)",
      borderColor: "rgba(75, 192, 192, 1)",
      borderWidth: 1}
    ],
  };

  return (
    <div>
      <h1 className="text-2xl font-bold mb-4">Future Coders Dashboard</h1>
      <div className="p-6 bg-white shadow rounded">
      <ChartComponent data={chartData} />
      </div>
    </div>
  );
};

export default Dashboard;
